import { Component } from "react";
import "./App.css";

class App extends Component {
  render() {
    const back = {
      backgroundColor: "grey",
    };
    return (
      <div>
        <header className="Nav">
          <img src="./logo/logo_white.png" />
        </header>
        <div style={back}>
          <h3>hi</h3>
        </div>
      </div>
    );
  }
}

export default App;
